import Layout from '../components/Layout';

const Index = () => (
	<Layout>
		<div className="container">
			
			<div className="columns">
				
				<div className="column">
					<div className="block">
						<p className="content">Lorem ipsum dolor sit amet.</p>
					</div>
				</div>
				<div className="column">sad</div>
			</div>
		</div>
	</Layout>
);

export default Index;
